import React from 'react';
import {Routes, Route} from 'rea'

import Chat from './components/Chat/Chat';
import Join from './components/Join/Join';

function App() {
  const path = window.location.pathname;
  let content;
  switch(path){
    case '/chat':
      content = <Chat/>
      break;
    default:
      content = <Join/>
      break;
  }
  return (
    <div>
      {content}
    </div>
  );
}

export default App;
